<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN"
          "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">
<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en">
<head>
  <meta http-equiv="Content-type" content="text/html; charset=utf-8" />
  <link rel="stylesheet" type="text/css" media="all"
        href="planet.css" />
  <title>jetpack dashboard</title>
</head>
<body>
<div id="issue">
  <div id="header">jetpack dashboard</div>
  <div id="body">
    <div class="column" id="row-labels">
      <div class="headline">&nbsp;</div>
      <div class="content">
        <div class="time-ago-0">
          <div class="blog-item">Within the last 8 hours</div>
        </div>
        <div class="time-ago-1">
          <div class="blog-item">8-16 hours ago</div>
        </div>
        <div class="time-ago-2">
          <div class="blog-item">16 hours to 1 day ago</div>
        </div>
        <div class="time-ago-3">
          <div class="blog-item">24-32 hours ago</div>
        </div>
        <div class="time-ago-4">
          <div class="blog-item">32-40 hours ago</div>
        </div>
        <div class="time-ago-5">
          <div class="blog-item">40 hours to 2 days ago</div>
        </div>
        <div class="time-ago-6">
          <div class="blog-item">48-56 hours ago</div>
        </div>
        <div class="time-ago-7">
          <div class="blog-item">56-64 hours ago</div>
        </div>
        <div class="time-ago-8">
          <div class="blog-item">64 hours to 3 days ago</div>
        </div>
        <div class="time-ago-9">
          <div class="blog-item">More than 3 days ago</div>
        </div>
      </div>
    </div>
  </div>
  <div id="footer">
    <div class="footer-content">
      This is an experimental redesign. You can read the documentation <a href="docs.html" target="_blank">here</a>.
    </div>
  </div>
</div>
</body>
<script src="jquery.js"></script>
<script src="querystring.js"></script>
<script src="http://www.google.com/jsapi?key=ABQIAAAAJx3zrQ948zAPURgWyn81qhS2a4DJtI1j92AGI9NRY09Yeif1PBQDibLXIz7XSH_5p6LARlompM6QGA"></script>
<script src="planet.js"></script>
</html>
